from collections import defaultdict

def count_divisors(n):
    divisors = defaultdict(int)
    for i in range(1, int(n ** 0.5) + 1):
        if n % i == 0:
            divisors[i] += 1
            divisors[n // i] += 1
    return divisors

def max_divisors(n, k):
    divisors = count_divisors(n)
