def path_to_equality(a, b):
    queue = deque([(a, b, 0)])
    visited = set()
    while queue:
        x, y, length = queue.popleft()
        if x == y:
            return length
        if (x, y) in visited:
            continue
        visited.add((x, y))
        queue.append(r(x, y, length + 1))
        queue.append(s(x, y, length + 1))

