from math import sqrt

def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def hybrid_integers(n):
    count = 0
    for p in range(2, int(sqrt(n)) + 1):
        if is_prime(p):
            for q in range(p + 1, int(sqrt(n)) + 1):
                if is_prime(q) and p * q * q <= n:
                    count += 1
    return count

